import React, { Component } from "react";
 
class Resume extends Component {
  render() {
    return (
      <div className=" float-lg-right float-md-right float-sm-right copybody">
          <h3>Education</h3>
           <p>Burlington College, Burlington VT</p>
          <p>Bacherlor Degree in Cinema Studies and Film Production</p>
        <h3>Skills</h3>
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>JavaScript</li>
          <li>React</li>
          <li>Dealer.com Products</li>
          <li>Inbound Marketing</li>
          <li>DDC Presence Award</li>
        </ul>
      </div>
    );
  }
}
 
export default Resume;
